        dp[idx] = min(idx, len(ring) - idx) + 1
    for i in range(1, m):
        for idx in pos[key[i]]:
            dp[idx] = min((dp[j] + min(abs(j - idx), len(ring) - abs(j - idx)) for j in pos[key[i - 1]])) + 1
    return min((dp[idx] for idx in pos[key[-1]]))

